import React from 'react';
import '../../App.css';
import './About.css';



export default function About() {
    return (
    <>
    <h1 className='about'>ABOUT</h1>
    <h2 className='name'>Elizabeth Coxon</h2>
    <p className='aboutSection'>I am a creative and ambitious artist</p>
    </>
    )
}
